#[temperature_probe btt_eddy]
#sensor_type: Generic 3950
#sensor_pin: eddy:gpio26
#horizontal_move_z: 2

###################end old eddy section commented out for eddy-ng###############

[respond]

[bed_mesh]
horizontal_move_z: 2
speed: 250
# For the mesh dimensions below, the coordinates need to be reachable by the center of the probe. 
mesh_min: 80, 60 # modify these according to the above guide. If the probe cannot reach then you will get a klipper error when trying to scan a bed mesh.
mesh_max: 365, 346 # modify these according to the above guide. If the probe cannot reach then you will get a klipper error when trying to scan a bed mesh.
probe_count: 80, 80
algorithm: bicubic
scan_overshoot: 5  #uncomment this section if you still have room left over on the X axis for some scan overshoot to product smoother movements and more accurate scanning. Uncommenting this should be fine if you are using a standard voron mount.


[safe_z_home]
home_xy_position: 170, 190
speed: 200
z_hop: 10
z_hop_speed: 5

